import React, { useState } from 'react';
import './App.css';

function App() {
  const [{ count, count2 }, setCount] = useState({ count: 10, count2: 20 });
  return (
    <>
      <button onClick={() => setCount((currentState) => ({ ...currentState, count: count + 1 }))}>
        +
      </button>
      <span>{count}</span>
      <span>{count2}</span>
    </>
  );
}

export default App;
